import { Container, Grid, Typography } from '@material-ui/core';
import styles from './Header.module.scss';

function Header () {
  return (
    <header className={styles.header}>
      <Container fixed justify="center" alignItems='center'>
        <Grid container>
          <Grid item xs={6} >
            Content
          </Grid>
        </Grid>
      </Container>
    </header>
  )
}

export default Header;
